// src/pages/AdminPanel.jsx
import React from 'react';
import { Link } from 'react-router-dom';

export default function AdminPanel() {
  return (
    <div className="container mt-4">
      <h2 className="mb-4">Panel de Administración</h2>
      <div className="list-group">
        <Link to="/admin/users" className="list-group-item list-group-item-action">Gestión de Usuarios</Link>
        <Link to="/admin/pets" className="list-group-item list-group-item-action">Gestión de Mascotas</Link>
        <Link to="/admin/activities" className="list-group-item list-group-item-action">Gestión de Actividades</Link>
        <Link to="/admin/lost-reports" className="list-group-item list-group-item-action">Reportes de Mascotas Perdidas</Link>
        <Link to="/admin/comments" className="list-group-item list-group-item-action">Comentarios</Link>
        <Link to="/admin/statistics" className="list-group-item list-group-item-action">Estadísticas y Notificaciones</Link>
      </div>
    </div>
  );
}
